package sdtlab.patient_module.domain;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;import java.sql.Date;@Setter@Getter@Entitypublic class Patient extends Person {    @Id    @GeneratedValue    private Long id;    public Patient(String firstName, String lastName, String email, String phone, String address, String gender, Date dob) {        super(firstName, lastName, email, phone, address, gender, dob);    }    public Patient() {    }}